window.templates={"modified_date":"Wed Jan 25 2023 23:53:14 GMT+0100 (Central European Standard Time)","any":{"default.js":{"_ct":"text/javascript","_pt":"resource/content","_content":"(function (res, writer, ctx) {\n  writer.start('text/html');\n\n  writer.write('name:' + res.name);\n  writer.write('<h1>render types:</h1>');\n  writer.write('<ul>');\n\n  var types = res.renderTypes;\n  for (var i = 0; i < types.length; i++) {\n    writer.write('<li>' + types[i] + '</li>');\n  }\n  writer.write('</ul>');\n\n  writer.write('<h1>properties:</h1>');\n  writer.write('<ul>');\n\n  for (var name in res._) {\n    var val = res._[name];\n    writer.write('<li>' + name + '=' + val + '</li>');\n  }\n\n  writer.write('</ul>');\n\n  var w = writer.makeNestedContentWriter();\n  ctx.listResourceNames('.').then(function (children) {\n    w.write('<h1>children:</h1>');\n    w.write('<ul>');\n\n    for (var i = 0; i < children.length; i++) {\n      var child = children[i];\n      w.write('<li>' + child + '</a></li>');\n    }\n    w.write('</ul>');\n    w.end();\n  });\n\n  writer.end();\n})\n"},"dump.js":{"_ct":"text/javascript","_pt":"resource/content","_content":"(function (res, writer, ctx) {\n  res['R'] = ctx.getRequestProperties();\n  res['Q'] = ctx.getQueryProperties();\n  res['C'] = ctx.getConfigProperties();\n\n  writer.start('application/json');\n  writer.write(JSON.stringify(res, null, 2));\n  writer.end();\n});\n"},"json.js":{"_ct":"text/javascript","_pt":"resource/content","_content":"(function (res, writer) {\n  writer.start('application/json');\n  writer.write(JSON.stringify(res, null, 2));\n  writer.end();\n});\n"},"pre-store.js":{"_ct":"text/javascript","_pt":"resource/content","_content":"(function (res, writer, ctx) {\n  res['_md'] = '' + (new Date().getTime());\n\n  writer.write(res);\n  writer.end();\n});\n"},"pre-render.js":{"_ct":"text/javascript","_pt":"resource/content","_content":"(function (res, writer, ctx) {\n  writer.end();\n});\n"}},"factory":{"hbs":{"pre-render.js":{"_ct":"text/javascript","_pt":"resource/content","_content":"(function (res, writer, ctx) {\n  var Handlebars = res.Handlebars;\n  \n/*\n * path \".\"\n * path \"/content\" \"res-list\"\n * APP_PREFIX for client side\n */\n\n  var path_func = function () {\n    var args = arguments;\n    var context = args[args.length-1].data.root;\n    var rv = [];\n    var i = 0;\n\n    if (context.C['APP_PREFIX']) rv.push(context.C['APP_PREFIX']);\n    if (context.C['P']) rv.push(context.C['P']);\n\n    for (;i < (args.length-1); i++) {\n      var p = args[i];\n      if (i == 0) {\n        if (p == '.') p = context.R['PATH'];\n        else p = Utils.absolute_path(p, context.R['PATH']);\n      }\n      else if (args.length > 2 && i == args.length-2) {\n        if (p !== '' && p.indexOf('.') === -1 && context.C['X']) rv.push(context.C['X']);\n      }\n      rv.push(p);\n    }\n\n    if (args.length == 2) {\n      if (context.R['SELECTOR']) {\n        rv.push(context.C['X']);\n        rv.push(context.R['SELECTOR']);\n      }\n    }\n\n    return rv.join('');\n  };\n\n  Handlebars.registerHelper('ref_path', function () {\n    var context = arguments[arguments.length-1].data.root;\n    var refurl = context.R['REF_URL'];\n\n    if (refurl) return refurl;\n    else return path_func.apply(this, arguments);\n  });\n\n  Handlebars.registerHelper('req_path', path_func);\n\n  Handlebars.registerHelper('res_path', function () {\n    var args = arguments;\n    var context = args[args.length-1].data.root;\n    var rv = [];\n    var i = 0;\n\n    for (;i < (args.length-1); i++) {\n      var p = args[i];\n      rv.push(p);\n    }\n\n    var p = rv.join('/');\n    return Utils.absolute_path(p, context.R['RES_PATH']);\n  });\n\n  Handlebars.registerHelper('set_Q', function (name, val, block) {\n    if (arguments.length == 3) {\n      var context = block.data.root._context\n      if (!context.pathInfo['query']) context.pathInfo['query'] = {};\n      context.pathInfo['query'][name] = val;\n    }\n    return '';\n  });\n\n  Handlebars.registerHelper('or', function () {\n    var args = arguments;\n\n    for (var i in args) {\n      if (args[i] !== null && args[i] !== undefined) return args[i];\n    }\n  });\n\n  Handlebars.registerHelper('val', function () {\n    var args = arguments;\n\n    if (!args[0]) return null;\n    else return args[1].replace('%s', args[0]);\n  });\n\n  Handlebars.registerHelper('and', function () {\n    var args = arguments;\n\n    for (var i in args) {\n      if (args[i]) return args[i+1];\n    }\n\n    return null;\n  });\n\n\n  Handlebars.registerHelper('eq', function (lvalue, rvalue, result, options) {\n    if (lvalue === rvalue) return result;\n    else return null;\n  });\n\n  /************************************************************************\n\n  {{#match Database.Tables.Count \">\" 5}}\n  There are more than 5 tables\n  {{/match}}\n\n  {{#match \"Test\" \"Test\"}}\n  Default comparison of \"===\"\n  {{/match}}\n\n   ************************************************************************/\n\n  Handlebars.registerHelper('match', function (lvalue, operator, rvalue, options) {\n    var operators = null;\n    var result = null;\n\n    if (arguments.length < 3) {\n      if (lvalue) {\n        operator.data.root._match_rval = true;\n        return operator.fn(this);\n      }\n      else return operator.inverse(this);\n    }\n\n    if (options === undefined) {\n      options = rvalue;\n      rvalue = operator;\n      operator = \"===\";\n    }\n\n    operators = {\n      '==': function (l, r) {\n        return l == r;\n      },\n      '===': function (l, r) {\n        return l === r;\n      },\n      '!=': function (l, r) {\n        return l != r;\n      },\n      '!==': function (l, r) {\n        return l !== r;\n      },\n      '<': function (l, r) {\n        return l < r;\n      },\n      '>': function (l, r) {\n        return l > r;\n      },\n      '<=': function (l, r) {\n        return l <= r;\n      },\n      '>=': function (l, r) {\n        return l >= r;\n      },\n      'startsWith': function (l, r) {\n        if (l && l.indexOf(r) === 0) return true;\n        else return false;\n      },\n      '!startsWith': function (l, r) {\n        if (l && l.indexOf(r) === 0) return false;\n        else return true;\n      },\n      'typeof': function (l, r) {\n        return typeof l == r;\n      }\n    };\n\n    if (!operators[operator]) {\n      throw new Error(\"Handlerbars Helper 'compare' doesn't know the operator \" + operator);\n    }\n\n    result = operators[operator](lvalue, rvalue);\n    if (result) options.data.root._match_rval = true;\n\n    if (result) return options.fn(this);\n    else return options.inverse(this);\n  });\n\n  Handlebars.registerHelper('default', function (options) {\n    var result = false;\n\n    if (options.data.root._match_rval) result = true;\n    delete options.data.root._match_rval;\n\n    if (!result) return options.fn(this);\n    else return options.inverse(this);\n  });\n\n  Handlebars.registerHelper('include_css', function (path, block) {\n    if (!block) return '';\n\n    var context = block.data.root._context;\n    var session = block.data.root._session;\n    var p = session.makeOutputPlaceholder();\n\n    context.resolveTemplateResourceContent(path).then(function(buff) {\n      if (buff) {\n        p.write('<style>'+buff+'</style>');\n      }\n      p.end();\n    });\n\n    return p.placeholder;\n  });\n\n  Handlebars.registerHelper('include_js', function (path, block) {\n    if (!block) return '';\n\n    var context = block.data.root._context;\n    var session = block.data.root._session;\n    var p = session.makeOutputPlaceholder();\n\n    context.resolveTemplateResourceContent(path).then(function(buff) {\n      if (buff) {\n        p.write('<script>'+buff+'</script>');\n      }\n      p.end();\n    });\n\n    return p.placeholder;\n  });\n\n  Handlebars.registerHelper('dump', function (block) {\n    if (!block) return '';\n    var rv = {};\n    var context = block['data']?block.data.root:block;\n\n    for (var key in context) {\n      var val = context[key];\n      if (key === '_context') continue;\n      if (key === '_session') continue;\n      \n      rv[key] = val;\n    }\n\n    return JSON.stringify(rv, null, 2);\n  });\n\n  writer.end();\n});\n"}}},"mime":{"text":{"css":{"minimize.js":{"_ct":"text/javascript","_pt":"resource/content","_content":"(function (res, writer, ctx) {\n  var clientside = (typeof window != 'undefined');\n  var xref = res['_xref'];\n\n  if (xref) {\n    var url = escape(xref);\n    writer.start('text/plain');\n    writer.write(url);\n    writer.end();\n  }\n  else if (clientside) {\n    if (res['isContentResource']) {\n      ctx.readResource('.', new ContentWriterAdapter('blob', function (data, ctype) {\n        var blob = new Blob([data], {\n          type: ctype ? ctype : 'application/octet-binary'\n        });\n        var url = URL.createObjectURL(blob);\n\n        writer.start('text/plain');\n        writer.write(`<link rel=\"stylesheet\" href=\"${url}\"></link>`);\n        writer.end();\n      }));\n    }\n    else {\n      writer.error(new Error('resource has no content'));\n      writer.end();\n    }\n  }\n  else {\n    var url = ctx.pathInfo.resourcePath;\n    writer.start('text/plain');\n    writer.write(`<link rel=\"stylesheet\" href=\"${url}\"></link>`);\n    writer.end();\n  }\n});\n"}},"javascript":{"minimize.js":{"_ct":"text/javascript","_pt":"resource/content","_content":"(function (res, writer, ctx) {\n  var clientside = (typeof window != 'undefined');\n  var xref = res['_xref'];\n\n  if (xref) {\n    var url = escape(xref);\n    writer.start('text/plain');\n    writer.write(url);\n    writer.end();\n  }\n  else if (clientside) {\n    if (res['isContentResource']) {\n      ctx.readResource('.', new ContentWriterAdapter('blob', function (data, ctype) {\n        var blob = new Blob([data], {\n          type: ctype ? ctype : 'application/octet-binary'\n        });\n        var url = URL.createObjectURL(blob);\n\n        writer.start('text/plain');\n        writer.write(`<script src=\"${url}\"></script>`);\n        writer.end();\n      }));\n    }\n    else {\n      writer.error(new Error('resource has no content'));\n      writer.end();\n    }\n  }\n  else {\n    var url = ctx.pathInfo.resourcePath;\n    writer.start('text/plain');\n    writer.write(`<script>${url}</script>`);\n    writer.end();\n  }\n});\n"}}}},"resource":{"content":{"default.js":{"_ct":"text/javascript","_pt":"resource/content","_content":"(function (res, writer, ctx) {\n  ctx.readResource('.', writer);\n});\n"},"edit.hbs":{"_ct":"text/plain","_pt":"resource/content","_content":"<!DOCTYPE html>\n<html lang=\"en\">\n\n<head>\n  <meta charset=\"utf-8\">\n  <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0, maximum-scale=1.0\">\n\n  <style>\n    textarea {\n      display: block;\n      width: 100%;\n      height: 400px;\n    }\n  </style>\n\n  <title>edit</title>\n</head>\n\n<body>\n  <ol>\n    <li><a href=\"{{req_path \"/\" \"res-list\"}}\">HOME</a></li>\n{{#include \".\" \"parents\"}}\n    <li><a href=\"{{req_path path \"res-list\"}}\">{{name}}</a></li>\n{{/include}}\n    <li class=\"active\">{{name}}</li>\n  </ol>\n\n{{#match isTextContentResource}}\n\n  <form method=\"post\" action=\"{{res_path R.PATH}}\">\n    <a href=\"{{req_path \"..\" \"res-list\"}}\">List</a>\n    \n    <button type=\"submit\">Save</button>\n    <input type=\"hidden\" name=\":forward\" value=\"{{req_path \".\"}}\">\n\n    <textarea autocorrect=\"off\" autocapitalize=\"none\" autocomplete=\"off\" autofocus=\"on\" spellcheck=\"false\" name=\"_content\">{{include_safe \".\" \"text\"}}</textarea>\n\n    <input type=\"hidden\" name=\"_rt\" value=\"resource/content\"></input>\n    <input type=\"hidden\" name=\"_ct\" value=\"{{contentType}}\"></input>\n  </form>\n\n{{/match}}\n{{#match contentType \"startsWith\" \"image/\"}}\n\n    <a href=\"{{req_path R.DIRNAME_APPEND \"res-list\"}}\">List</a>\n    <a target=\"_blank\" href=\"{{include \".\" \"externalize\"}}\">View</a>\n\n    <img class=\"image\" src=\"{{include \".\" \"externalize\"}}\"></img>\n\n{{/match}}\n{{#match contentType \"startsWith\" \"application/pdf\"}}\n\n    <a href=\"{{req_path R.DIRNAME_APPEND \"res-list\"}}\">List</a>\n    <a target=\"_blank\" href=\"{{include \".\" \"externalize\"}}\">View</a>\n\n    <iframe class=\"pdf\" src=\"{{include \".\" \"externalize\"}}\"></iframe>\n\n{{/match}}\n{{#default}}\n\n    <div>unknown file type of {{contentType}}</div>\n    <a href=\"{{include \".\" \"externalize\"}}\" download target=\"_blank\">Download</a>\n\n{{/default}}\n\n</body>\n\n</html>\n"},"externalize.js":{"_ct":"text/javascript","_pt":"resource/content","_content":"(function (res, writer, ctx) {\n  var clientside = (typeof window != 'undefined');\n  var xref = res['_xref'];\n\n  if (xref) {\n    var url = escape(xref);\n    writer.start('text/plain');\n    writer.write(url);\n    writer.end();\n  }\n  else if (clientside) {\n    if (res['isContentResource']) {\n      ctx.readResource('.', new ContentWriterAdapter('blob', function (data, ctype) {\n        var blob = new Blob([data], {\n          type: ctype ? ctype : 'application/octet-binary'\n        });\n        var url = URL.createObjectURL(blob);\n\n        writer.start('text/plain');\n        writer.write(url);\n        writer.end();\n      }));\n    }\n    else {\n      writer.error(new Error('resource has no content'));\n      writer.end();\n    }\n  }\n  else {\n    var url = ctx.pathInfo.resourcePath;\n    writer.start('text/plain');\n    writer.write(url);\n    writer.end();\n  }\n});\n"},"import.js":{"_ct":"text/javascript","_pt":"resource/content","_content":"(function (res, writer, ctx) {\n  var path = ctx.getCurrentDataPath();\n\n  ctx.readResource('.', new ContentWriterAdapter('utf8', function (buff) {\n    ctx.storeResource(path, {\n      '_content':buff,\n      ':import':path\n    }, \n    function() {\n      writer.start('text/plain');\n      writer.write('done');\n      writer.end();\n    });\n  }));\n});\n"},"res-importto.hbs":{"_ct":"text/plain","_pt":"resource/content","_content":"<!DOCTYPE html>\n<html lang=\"en\">\n\n<head>\n  <meta charset=\"utf-8\">\n  <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1\">\n  <link rel=\"icon\" href=\"data:;base64,iVBORw0KGgo=\">\n\n  <title>Import to</title>\n\n  <link href=\"{{C.BOOTSTRAP_CSS}}\" rel=\"stylesheet\">\n</head>\n\n<body>\n\n  <div role=\"dialog\">\n    <div class=\"modal-dialog\" role=\"document\">\n      <div class=\"modal-content\">\n        <div class=\"modal-header\">\n          <a class=\"close\" href=\"{{C.P}}{{R.PATH_APPEND}}../{{C.X}}res-list\"><span aria-hidden=\"true\">&times;</span></a>\n          <h4 class=\"modal-title\">Import Resources</h4>\n        </div>\n        <div class=\"modal-body\">\n\n          <h1>Import archive</h1>\n\n          <ol class=\"breadcrumb\">\n            <li class=\"active\">HOME</li>\n            {{#include \".\" \"parents\"}}\n              <li class=\"active\">{{name}}</li>\n            {{/include}}\n            <li>{{R.NAME}}</li>\n          </ol>\n\n          <h1>to</h1>\n\n          <ol class=\"breadcrumb\">\n            <li><a href=\"{{C.P}}{{R.PATH}}{{C.X}}res-importto/\">HOME</a></li>\n            {{#include R.DATA_PATH \"parents\"}}\n              <li><a href=\"{{C.P}}{{R.PATH}}{{C.X}}res-importto{{path}}\">{{name}}</a></li>\n            {{/include}}\n            <li class=\"active\">{{R.DATA_NAME}}</li>\n          </ol>\n\n          <form method=\"post\" action=\"{{C.P}}{{R.PATH}}{{C.X}}import{{R.DATA_PATH}}\">\n            <table class=\"table\">\n              {{#include R.DATA_PATH \"children\"}}\n                {{#if isContentResource}}\n                  <tr>\n                    <td>\n                      <i class=\"glyphicon glyphicon-file\"></i> {{name}}\n                    </td>\n                  </tr>\n                {{else}}\n                  <tr>\n                    {{#match path \"!startsWith\" R.PATH}}\n                      <td>\n                        <i class=\"glyphicon glyphicon-folder-close\"></i> <a href=\"{{C.P}}{{R.PATH}}{{C.X}}res-importto{{path}}\">{{name}}</a>\n                      </td>\n                    {{/match}}\n                  </tr>\n                {{/if}}\n\n              {{/include}}\n\n            </table>\n\n            <input type=\"hidden\" name=\":forward\" value=\"{{C.P}}{{R.DATA_PATH}}{{C.X}}res-list\">\n\n            <div class=\"modal-footer\">\n              <a class=\"btn btn-default\" href=\"{{C.P}}{{R.PATH_APPEND}}../{{C.X}}res-list\">Cancel</a>\n              <input class=\"btn btn-success\" type=\"submit\" value=\"Import\">\n            </div>\n\n          </form>\n        </div><!-- /.modal-content -->\n      </div><!-- /.modal-dialog -->\n    </div><!-- /.modal -->\n\n</body>\n\n</html>\n"},"res-list.js":{"_ct":"text/javascript","_pt":"resource/content","_content":"(function (res, writer, context) {\n  context.forwardRequest(context.getCurrentResourcePath() + '.x-edit');\n});\n"},"text.js":{"_ct":"text/javascript","_pt":"resource/content","_content":"(function (res, writer, ctx) {\n  if (res && res['isContentResource']) {\n    ctx.readResource('.', new ContentWriterAdapter('utf8', function (data, ctype) {\n      writer.start('text/plain');\n      writer.write(data);\n      writer.end();\n    }));\n  }\n  else {\n    writer.error(new Error('resource has no content'));\n    writer.end();\n  }\n});\n"}},"index":{"children.js":{"_ct":"text/javascript","_pt":"resource/content","_content":"(function (res, writer, context) {\n  writer.start('object/javascript');\n  var qp = context.getQueryProperties();\n  var qry = '';\n\n  if (qp && qp['q']) qry = qp['q'];\n\n  /*\n  res.searchChildrenResources(qry, function (children) {\n    var rv = [];\n\n    for (var i = 0; i < children.length; i++) {\n      var res = children[i];\n      var map = context.makeContextMap(res);\n      var name = res.getName();\n\n      map['name'] = name;\n      map['path'] = Utils.filename_path_append(context.getCurrentResourcePath(), name);\n\n      rv.push(map);\n    }\n\n    writer.write(rv);\n  });\n  */\n  writer.end();\n\n})\n"},"res-create.hbs":{"_ct":"text/plain","_pt":"resource/content","_content":"<!DOCTYPE html>\n<html lang=\"en\">\n\n<head>\n  <meta charset=\"utf-8\">\n  <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1\">\n  <link rel=\"icon\" href=\"data:;base64,iVBORw0KGgo=\">\n\n  <title>index content</title>\n\n  <link href=\"{{C.BOOTSTRAP_CSS}}\" rel=\"stylesheet\">\n</head>\n\n<body>\n\n  <div role=\"dialog\">\n    <div class=\"modal-dialog\" role=\"document\">\n      <div class=\"modal-content\">\n        <div class=\"modal-header\">\n          <a class=\"close\" href=\"{{req_path R.PATH \"res-list\"}}\"><span aria-hidden=\"true\">&times;</span></a>\n          <h4 class=\"modal-title\">Index Resource Content</h4>\n        </div>\n        <div class=\"modal-body\">\n\n\n          <ol class=\"breadcrumb\">\n            <li class=\"active\">HOME</li>\n            {{#include \".\" \"parents\"}}\n              <li class=\"active\">{{name}}</li>\n            {{/include}}\n            <li>{{R.NAME}}</li>\n          </ol>\n\n          <h5>Upload File</h5>\n\n          <form class=\"form-inline\" method=\"post\" enctype=\"multipart/form-data\" action=\"{{C.P}}{{R.PATH_APPEND}}{:name}\">\n            <div class=\"form-group\">\n              <input class=\"form-control\" type=\"file\" name=\":filename\" value=\"\">\n              <input class=\"form-control\" name=\":name|:filename|newUUID\" value=\"\" autocomplete=\"off\" placeholder=\"file name\">\n              <input type=\"hidden\" name=\":forward\" value=\"{{req_path R.PATH \"res-list\"}}\">\n              <button class=\"form-control btn btn-success\" type=\"submit\">\n                <span class=\"glyphicon glyphicon-plus\"></span>\n              </button>\n\n            </div>\n          </form>\n\n          <h5>Import File</h5>\n          <form class=\"form-inline\" method=\"post\" enctype=\"multipart/form-data\" action=\"{{R.PATH}}\">\n            <div class=\"form-group\">\n              <input class=\"form-control\" type=\"file\" name=\":import\" value=\"\">\n              <input type=\"hidden\" name=\":forward\" value=\"{{req_path R.PATH \"res-list\"}}\">\n\n              <button class=\"form-control btn btn-success\" type=\"submit\">\n                <span class=\"glyphicon glyphicon-plus\"></span>\n              </button>\n            </div>\n          </form>\n\n        </div>\n        <div class=\"modal-footer\">\n          <a class=\"btn btn-default\" href=\"{{C.P}}{{R.PATH}}{{C.X}}res-list\">Cancel</a>\n        </div>\n      </div><!-- /.modal-content -->\n    </div><!-- /.modal-dialog -->\n  </div><!-- /.modal -->\n\n\n</body>\n\n</html>\n"},"res-list.hbs":{"_ct":"text/plain","_pt":"resource/content","_content":"<!DOCTYPE html>\n<html lang=\"en\">\n\n<head>\n  <meta charset=\"utf-8\">\n  <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n\n  <title>Index Search</title>\n</head>\n\n<body>\n\n  <ol>\n    <li><a href=\"{{req_path \"/\"}}\">HOME</a></li>\n{{#include \".\" \"parents\"}}\n    <li><a href=\"{{req_path path}}\">{{name}}</a></li>\n{{/include}}\n    <li class=\"active\">{{name}}</li>\n  </ol>\n\n  <a href=\"{{req_path \".\" \"res-create\"}}\">create</a>\n\n  <form method=\"get\" action=\"/index{{C.X}}res-list\">\n    <input name=\"q\" type=\"text\" placeholder=\"search\" value=\"{{Q.q}}\">\n  </form>\n\n  <table>\n{{#include \".\" \"children\"}}\n    <tr>\n      <td>\n        <a href=\"{{C.P}}{{_.reference}}{{R.SUFFIX}}\">{{name}}</a>\n      </td>\n      <td>\n        {{_.score}}\n      </td>\n      <td>\n        <a class=\"btn btn-default glyphicon glyphicon-trash\" href=\"{{C.P}}{{path}}{{C.X}}res-delete\"></a>\n      </td>\n    </tr>\n{{/include}}\n  </table>\n\n</body>\n</html>\n"}},"node":{"children.js":{"_ct":"text/javascript","_pt":"resource/content","_content":"(async function (res, writer, ctx) {\n  writer.start('object/javascript');\n\n  let children = await ctx.listResources('.');\n  let rv = [];\n\n  children.sort(function(a, b) {\n    return a.name.localeCompare(b.name);\n  });\n\n  writer.write(children);\n})\n"},"export.js":{"_ct":"text/javascript","_pt":"resource/content","_content":"(function (res, writer, context) {\n  let out = writer;\n  let processing = 0;\n  let ended = false;\n  let count = 0;\n  let path = context.getCurrentDataPath();\n\n  let export_content = function (data) {\n    let func = data['_content'];\n    let ct = data['_ct'];\n    let bin = true;\n\n    if (Utils.is_texttype(ct)) bin = false;\n\n    func(new ContentWriterAdapter(bin ? null : 'utf8', function (buff) {\n\n      if (bin) {\n        data['_ct'] = 'base64:' + (ct ? ct : '');\n        data['_content'] = Utils.ArrayBuffer2base64(buff);\n      }\n      else data['_content'] = buff;\n\n      if (count > 0) out.write('\\n,\\n');\n      out.write(JSON.stringify(data, null, 2));\n\n      processing--;\n      done();\n    }));\n  };\n\n  let done = function () {\n    if (processing === 0 && ended) {\n      out.write('\\n]');\n      out.end();\n      if (out !== writer) writer.end();\n    }\n  };\n\n  let export_children = function () {\n    let path = res['path'];\n    context.exportAllResources(path, 0, {\n      start: function (ctype) {\n        out.start('application/package-json');\n        out.write('[\\n');\n      },\n      write: function (data) {\n\n        if (data.values['_content']) {\n          processing++;\n          export_content(data.values);\n        }\n        else {\n          if (count > 0) out.write('\\n,\\n');\n          out.write(JSON.stringify(data.values, null, 2));\n        }\n        count++;\n      },\n      error: function (err) {\n        console.log(err);\n      },\n      end: function () {\n        ended = true;\n        done();\n      }\n    }, true);\n  };\n\n  if (path) {\n    context.resolveResource(path).then(function(ores) {\n      if (ores) {\n        out = ores.getWriter();\n        export_children();\n      }\n      else {\n        context.storeAndResolveResource(path, {'_content':''}).then(function(ores) {\n          out = ores.getWriter();\n          export_children();\n        });\n      }\n    });\n  }\n  else {\n    export_children();\n  }\n\n});\n"},"flushcache.js":{"_ct":"text/javascript","_pt":"resource/content","_content":"(function (res, writer, context) {\n  writer.start('text/plain');\n\n  if (res.flushResourceCache) {\n    res.flushResourceCache();\n    writer.write('DONE');\n  }\n  else {\n    writer.write('NOT_SUPPORTED');\n  }\n\n  writer.end();\n})\n"},"keyvalues.js":{"_ct":"text/javascript","_pt":"resource/content","_content":"(function (res, writer, ctx) {\n  writer.start('object/javascript');\n  \n  let rv = [];\n  let names = Object.keys(res._);\n\n  names.sort(function(a, b) {\n    return a.localeCompare(b);\n  });\n\n  for (var i = 0; i < names.length; i++) {\n    var name = names[i];\n    var val = res._[name];\n\n    rv.push({\n      name: name,\n      value: val\n    });\n  }\n\n  writer.write(rv);\n  writer.end();\n})\n"},"parentpaths.js":{"_ct":"text/javascript","_pt":"resource/content","_content":"(function (res, writer, ctx) {\n  writer.start('object/javascript');\n\n  var path = ctx.getCurrentResourcePath();\n\n  var parentPaths = [];\n  var ps = Utils.split_path(path);\n  ps.pop();\n\n  while (ps.length > 0) {\n    var rpath = ps.join('/');\n    var name = ps.pop();\n    var map = res.clone();\n\n    if (name === '') continue;\n\n    map['path'] = '/' + rpath;\n    map['name'] = name;\n\n    parentPaths.unshift(map);\n  }\n\n  writer.write(parentPaths);\n  writer.end();\n\n});\n"},"parents.js":{"_ct":"text/javascript","_pt":"resource/content","_content":"(async function (res, writer, ctx) {\n  writer.start('object/javascript');\n\n  let path = ctx.getCurrentResourcePath();\n\n  let parentResources = [];\n  let parentPaths = [];\n  let ps = Utils.split_path(path);\n  ps.pop();\n\n  while (1) {\n    let rpath = ps.join('/');\n    if (rpath == '') break;\n    \n    let r = await ctx.resolveResource('/'+rpath);\n    parentResources.unshift(r);\n\n    ps.pop();\n  }\n\n  writer.write(parentResources);\n  writer.end();\n});\n"},"properties.js":{"_ct":"text/javascript","_pt":"resource/content","_content":"(function (res, writer, ctx) {\n  writer.start('object/javascript');\n  writer.write(res._);\n  writer.end();\n})\n"},"res-create.hbs":{"_ct":"text/plain","_pt":"resource/content","_content":"<!DOCTYPE html>\n<html lang=\"en\">\n\n<head>\n  <meta charset=\"utf-8\">\n  <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1\">\n  <link rel=\"icon\" href=\"data:;base64,iVBORw0KGgo=\">\n\n  <title>create</title>\n</head>\n\n<body>\n\n  <h4>Create New Resource</h4>\n\n  <ol>\n    <li>HOME</li>\n{{#include \".\" \"parents\"}}\n    <li>{{name}}</li>\n{{/include}}\n    <li>{{name}}</li>\n  </ol>\n\n  <h5>Resource Node</h5>\n  \n  <form method=\"post\" action=\"{{res_path R.PATH \"{:name}\"}}\">\n    <input name=\":name|newUUID\" value=\"\" autocomplete=\"off\" placeholder=\"name\">\n\n    <select name=\"_rt\">\n      <option value=\"\">type not set</option>\n      <option disabled>user templates:</option>\n{{#include C.USER_TEMPLATES \"rendertemplates\"}}\n      <option value=\"{{this}}\">{{this}}</option>\n{{/include}}\n    </select>\n              \n    <input type=\"hidden\" name=\":forward\" value=\"{{req_path R.PATH \"res-list\"}}\">\n    <button type=\"submit\">add</button>\n  </form>\n\n  <h5>Create Empty File</h5>\n\n  <form method=\"post\" action=\"{{res_path R.PATH \"{:name}\"}}\">\n    <input name=\":name|newUUID\" value=\"\" autocomplete=\"off\" placeholder=\"file name\">\n    <input type=\"hidden\" name=\"_content\" value=\"\"></input>\n    \n    <input type=\"hidden\" name=\":forward\" value=\"{{req_path \".\" \"res-list\"}}\">\n    <button type=\"submit\">add</button>\n  </form>\n\n  <h5>Upload File</h5>\n\n  <form method=\"post\" enctype=\"multipart/form-data\" action=\"{{res_path R.PATH \"{:name}\"}}\">\n    <input type=\"file\" name=\":filename\" value=\"\">\n    <input name=\":name|:filename|newUUID\" value=\"\" autocomplete=\"off\" placeholder=\"file name\">\n    <input type=\"hidden\" name=\":forward\" value=\"{{req_path \".\" \"res-list\"}}\">\n    <button type=\"submit\">add</button>\n  </form>\n\n  <h5>Import File</h5>\n  \n  <form method=\"post\" enctype=\"multipart/form-data\" action=\"{{R.PATH}}\">\n    <input type=\"file\" name=\":import\" value=\"\">\n    <input type=\"hidden\" name=\":forward\" value=\"{{req_path \".\" \"res-list\"}}\">\n\n    <button type=\"submit\">add</button>\n  </form>\n\n  <a href=\"{{req_path \".\" \"res-list\"}}\">Cancel</a>\n\n</body>\n</html>\n"},"res-copyto.hbs":{"_ct":"text/plain","_pt":"resource/content","_content":"<!DOCTYPE html>\n<html lang=\"en\">\n\n<head>\n  <meta charset=\"utf-8\">\n  <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1\">\n  <link rel=\"icon\" href=\"data:;base64,iVBORw0KGgo=\">\n\n  <title>copy to</title>\n</head>\n\n<body>\n  <h1>Copy from</h1>\n\n  <ol>\n    <li>HOME</li>\n{{#include \".\" \"parents\"}}\n    <li>{{name}}</li>\n{{/include}}\n    <li>{{name}}</li>\n  </ol>\n\n  <h1>to</h1>\n\n  <ol>\n    <li><a href=\"{{req_path \".\" \"res-copyto\"}}/\">HOME</a></li>\n{{#include R.DATA_PATH \"parents\"}}\n    <li><a href=\"{{req_path \".\" \"res-copyto\"}}{{path}}\">{{name}}</a></li>\n{{/include}}\n    <li class=\"active\">{{R.DATA_NAME}}</li>\n  </ol>\n\n  <form method=\"POST\" action=\"{{R.PATH}}\">\n    <table>\n{{#include R.DATA_PATH \"children\"}}\n  {{#if isContentResource}}\n      <tr>\n        <td>{{name}}</td>\n      </tr>\n  {{else}}\n      <tr>\n    {{#match path \"!startsWith\" R.PATH}}\n        <td>\n          <a href=\"{{req_path \".\" \"res-copyto\"}}{{path}}\">{{name}}</a>\n        </td>\n    {{/match}}\n      </tr>\n  {{/if}}\n{{/include}}\n      <tr>\n        <td>\n          <input name=\":name|newUUID\" value=\"Copy of {{R.NAME}}\" autocorrect=\"off\" autocapitalize=\"off\" autocomplete=\"off\" spellcheck=\"false\">\n        </td>\n      </tr>\n    </table>\n\n    <input type=\"hidden\" name=\":copyto\" value=\"{{res_path R.DATA_PATH \"{:name}\"}}\">\n    <input type=\"hidden\" name=\":forward\" value=\"{{req_path R.DATA_PATH \"res-list\"}}\">\n\n    <a target=\"_blank\" href=\"{{req_path \".\" \"export\"}}\">Export</a>\n    <a href=\"{{req_path \".\" \"res-exportto\"}}{{R.DATA_PATH}}\">Export to...</a>\n{{#if isContentResource}}\n    <a href=\"{{req_path \".\" \"res-importto\"}}{{R.DATA_PATH}}\">Import to...</a>\n{{/if}}\n\n    <a href=\"{{req_path \"../\" \"res-list\"}}\">Cancel</a>\n    <input type=\"submit\" value=\"Copy\">\n  </form>\n\n</body>\n</html>\n"},"res-delete.hbs":{"_ct":"text/plain","_pt":"resource/content","_content":"<!DOCTYPE html>\n<html lang=\"en\">\n\n<head>\n  <meta charset=\"utf-8\">\n  <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1\">\n  <link rel=\"icon\" href=\"data:;base64,iVBORw0KGgo=\">\n\n  <title>Delete</title>\n\n</head>\n\n<body>\n\n  <h4 class=\"modal-title\">Delete Resource</h4>\n\n  <ol>\n    <li>HOME</li>\n{{#include \".\" \"parents\"}}\n    <li>{{name}}</li>\n{{/include}}\n    <li>{{name}}</li>\n  </ol>\n\n  <h4>Are you sure you want to delete \"{{name}}\"?</h4>\n\n  <form method=\"POST\" action=\"{{res_path \".\"}}\">\n    <a href=\"{{req_path \"../\" \"res-list\"}}\">Cancel</a>\n\n    <input type=\"hidden\" name=\"_rt\" value=\"{{renderType}}\">\n    <input type=\"hidden\" name=\":delete\" value=\"{{res_path \".\"}}\">\n    <input type=\"hidden\" name=\":forward\" value=\"{{ref_path \"/../\" \"res-list\"}}\">\n    <input type=\"submit\" value=\"Delete\">\n  </form>\n\n</body>\n\n</html>\n"},"res-exportto.hbs":{"_ct":"text/plain","_pt":"resource/content","_content":"<!DOCTYPE html>\n<html lang=\"en\">\n\n<head>\n  <meta charset=\"utf-8\">\n  <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1\">\n  <link rel=\"icon\" href=\"data:;base64,iVBORw0KGgo=\">\n\n  <title>export to</title>\n</head>\n\n<body>\n  <h1>Export from</h1>\n\n  <ol>\n    <li>HOME</li>\n{{#include \".\" \"parents\"}}\n    <li>{{name}}</li>\n{{/include}}\n    <li>{{name}}</li>\n  </ol>\n\n  <h1>to</h1>\n\n  <ol>\n    <li><a href=\"{{req_path \".\" \"res-exportto\"}}/\">HOME</a></li>\n{{#include R.DATA_PATH \"parents\"}}\n    <li><a href=\"{{req_path \".\" \"res-exportto\"}}{{path}}\">{{name}}</a></li>\n{{/include}}\n    <li class=\"active\">{{R.DATA_NAME}}</li>\n  </ol>\n\n  <form method=\"POST\" action=\"{{res_path \".\"}}{{C.X}}export{{res_path R.DATA_PATH \"{:name}\"}}\">\n    <table>\n{{#include R.DATA_PATH \"children\"}}\n  {{#if isContentResource}}\n      <tr>\n        <td>\n          {{name}}\n        </td>\n      </tr>\n  {{else}}\n      <tr>\n    {{#match path \"!startsWith\" R.PATH}}\n        <td>\n          <a href=\"{{req_path \".\" \"res-exportto\"}}{{path}}\">{{name}}</a>\n        </td>\n    {{/match}}\n      </tr>\n  {{/if}}\n{{/include}}\n      <tr>\n        <td>\n          <input name=\":name|newUUID\" value=\"{{R.NAME}}.json\" autocorrect=\"off\" autocapitalize=\"off\" autocomplete=\"off\" spellcheck=\"false\">\n        </td>\n      </tr>\n\n    </table>\n\n    <input type=\"hidden\" name=\":forward\" value=\"{{req_path R.DATA_PATH \"res-list\"}}\">\n    <a href=\"{{req_path \"../\" \"res-list\"}}\">Cancel</a>\n    <input type=\"submit\" value=\"Export\">\n  </form>\n\n</body>\n\n</html>\n"},"res-list-actions.hbs":{"_ct":"text/plain","_pt":"resource/content","_content":"{{#if renderType}}\n  <a target=\"_blank\" href=\"{{req_path path \"\"}}\">v</a>\n{{/if}}\n\n  <a href=\"{{req_path path \"res-delete\"}}\">d</a>\n  <a href=\"{{req_path path \"res-copyto\"}}{{path}}/..\">c</a>\n  <a href=\"{{req_path path \"res-moveto\"}}{{path}}/..\">m</a>\n  <a href=\"{{req_path path \"res-properties\"}}\">p</a>\n"},"res-list.css":{"_ct":"text/css","_pt":"resource/content","_content":"body {\n  background-color: red;\n}\n"},"res-list.hbs":{"_ct":"text/plain","_pt":"resource/content","_content":"<!DOCTYPE html>\n<html lang=\"en\">\n\n<head>\n  <meta charset=\"utf-8\">\n  <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n  <meta name=\"viewport\" content=\"user-scalable=no,width=device-width, initial-scale=1.0\">\n  <link rel=\"icon\" href=\"data:;base64,iVBORw0KGgo=\">\n  \n  <style>\n  table {\n    width: 100%;\n  }\n\n  table td {\n    border: 1px solid gray;\n  }\n  </style>\n\n  <title>list</title>\n</head>\n\n<body>\n  <ol>\n    <li><a href=\"{{req_path \"/\"}}\">HOME</a></li>\n{{#include \".\" \"parents\"}}\n    <li><a href=\"{{req_path path}}\">{{name}}</a></li>\n{{/include}}\n    <li class=\"active\">{{name}}</li>\n  </ol>\n\n  <div>\n    <a href=\"{{req_path \".\" \"res-create\"}}\">n</a>\n    <a href=\"{{req_path \".\" \"res-renderer\"}}\">r</a>\n    <a href=\"{{req_path \".\" \"res-properties\"}}\">p</a>\n    <a target=\"_blank\" href=\"{{req_path \".\" \"dump\"}}\">x</a>\n{{#if renderType}}\n    <a target=\"_blank\" href=\"{{req_path \".\"}}\">Render As \"{{renderType}}\"</a>\n{{/if}}\n  </div>\n\n  <table>\n{{#include \".\" \"keyvalues\"}}\n    <tr>\n      <td>\n        {{name}}\n      </td>\n      <td>\n        {{value}}\n      </td>\n    </tr>\n{{/include}}\n  </table>\n\n  <table>\n{{#include \".\" \"children\"}}\n  {{#if isContentResource}}\n    <tr>\n      <td>\n        <a href=\"{{req_path path \"edit\"}}\">{{name}}</a>\n      </td>\n      <td>\n        {{contentType}} ({{contentSize}})\n      </td>\n      <td>\n        {{include path \"res-list-actions\"}}\n      </td>\n    </tr>\n  {{else}}\n    <tr>\n      <td>\n        <a href=\"{{req_path path}}\">{{name}}</a>\n      </td>\n      <td>\n    {{#if renderType}}\n        <a href=\"{{req_path C.USER_TEMPLATES \"/\" renderType \"res-list\"}}\">{{renderType}}</a>\n    {{else}}\n        {{type}}\n    {{/if}}\n        <a href=\"{{req_path path \"res-renderer\"}}\">renderer</a>\n      </td>\n      <td>\n        {{include path \"res-list-actions\"}}\n      </td>\n    </tr>\n  {{/if}}\n{{/include}}\n  </table>\n</body>\n\n</html>\n"},"res-moveto.hbs":{"_ct":"text/plain","_pt":"resource/content","_content":"<!DOCTYPE html>\n<html lang=\"en\">\n\n<head>\n  <meta charset=\"utf-8\">\n  <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1\">\n  <link rel=\"icon\" href=\"data:;base64,iVBORw0KGgo=\">\n\n  <title>move to</title>\n</head>\n\n<body>\n  <h1>Move from</h1>\n\n  <ol>\n    <li>HOME</li>\n{{#include \".\" \"parents\"}}\n    <li>{{name}}</li>\n{{/include}}\n    <li>{{name}}</li>\n  </ol>\n\n  <h1>to</h1>\n\n  <ol>\n    <li><a href=\"{{req_path \".\" \"res-moveto\"}}/\">HOME</a></li>\n{{#include R.DATA_PATH \"parents\"}}\n    <li><a href=\"{{req_path \".\" \"res-moveto\"}}{{path}}\">{{name}}</a></li>\n{{/include}}\n    <li class=\"active\">{{R.DATA_NAME}}</li>\n  </ol>\n\n  <form method=\"POST\" action=\"{{R.PATH}}\">\n\n  <table class=\"table\">\n{{#include R.DATA_PATH \"children\"}}\n  {{#if isContentResource}}\n    <tr>\n      <td>{{name}}</td>\n    </tr>\n  {{else}}\n    <tr>\n    {{#match path \"!startsWith\" R.PATH}}\n      <td>\n        <a href=\"{{req_path \".\" \"res-moveto\"}}{{path}}\">{{name}}</a>\n      </td>\n    {{/match}}\n      </tr>\n  {{/if}}\n\n  {{/include}}\n      <tr>\n        <td>\n          <input name=\":name|newUUID\" value=\"{{R.NAME}}\" autocomplete=\"off\">\n        </td>\n      </tr>\n    </table>\n\n    <input type=\"hidden\" name=\":moveto\" value=\"{{res_path R.DATA_PATH \"{:name}\"}}\">\n    <input type=\"hidden\" name=\":forward\" value=\"{{req_path R.DATA_PATH \"res-list\"}}\">\n\n    <a href=\"{{req_path \"../\" \"res-list\"}}\">Cancel</a>\n    <input type=\"submit\" value=\"Move\">\n\n  </form>\n\n</body>\n</html>\n"},"res-properties.hbs":{"_ct":"text/plain","_pt":"resource/content","_content":"<!DOCTYPE html>\n<html lang=\"en\">\n\n<head>\n  <meta charset=\"utf-8\">\n  <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0, maximum-scale=1.0\">\n  <link rel=\"icon\" href=\"data:;base64,iVBORw0KGgo=\">\n\n  <title>properties</title>\n</head>\n\n<body>\n\n  <h4 class=\"modal-title\">Resource Properties</h4>\n\n  <ol>\n    <li>HOME</li>\n{{#include \".\" \"parents\"}}\n    <li>{{name}}</li>\n{{/include}}\n    <li>{{name}}</li>\n  </ol>\n\n  <h4>properties:</h4>\n\n{{#include \".\" \"keyvalues\"}}\n  <label>{{name}}</label>\n  <input name=\"{{name}}\" value=\"{{value}}\" form=\"save_form\" autocorrect=\"off\" autocapitalize=\"none\" autocomplete=\"off\" spellcheck=\"false\">\n  \n  <form method=\"POST\" action=\"{{res_path \".\"}}\">\n    <input type=\"hidden\" name=\"{{name}}\" value=\"\">\n    <input type=\"hidden\" name=\":forward\" value=\"{{req_path}}\">\n    <button type=\"submit\" name=\"{{name}}\" value=\"\">del</button>\n  </form>\n{{/include}}\n\n  <form method=\"POST\" action=\"{{res_path \".\"}}\">\n    <input name=\":name\" value=\"\" autocorrect=\"off\" autocapitalize=\"none\" autocomplete=\"off\" spellcheck=\"false\" placeholder=\"name\">\n    <input name=\"{:name}\" value=\"\" autocorrect=\"off\" autocapitalize=\"none\" autocomplete=\"off\" spellcheck=\"false\" placeholder=\"value\">\n    <button type=\"submit\" value=\"add\">add</button>\n    <input type=\"hidden\" name=\":forward\" value=\"{{req_path R.PATH \"res-properties\"}}\">\n  </form>\n\n  <a href=\"{{req_path \".\" \"res-renderer\"}}\">Renderer Properties...</a>\n\n  <form method=\"POST\" id=\"save_form\" action=\"{{res_path}}\">\n    <a href=\"{{req_path \".\" \"res-list\"}}\">Cancel</a>\n    <input type=\"hidden\" name=\":forward\" value=\"{{req_path \".\" \"res-list\"}}\">\n    <input type=\"submit\" value=\"Save\">\n  </form>\n\n</body>\n\n</html>\n"},"res-renderer.hbs":{"_ct":"text/plain","_pt":"resource/content","_content":"<!DOCTYPE html>\n<html lang=\"en\">\n\n<head>\n  <meta charset=\"utf-8\">\n  <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0, maximum-scale=1.0\">\n  <link rel=\"icon\" href=\"data:;base64,iVBORw0KGgo=\">\n\n  <title>renderer properties</title>\n</head>\n\n<body>\n\n  <h4 class=\"modal-title\">Renderer Properties</h4>\n  \n\n  <ol>\n    <li>HOME</li>\n{{#include \".\" \"parents\"}}\n    <li>{{name}}</li>\n{{/include}}\n    <li>{{R.NAME}}</li>\n  </ol>\n\n  <form method=\"POST\" id=\"save_form\" action=\"{{R.PATH}}\">\n    <h4>Set User Defined Renderers</h4>\n    \n    <p>User defined renderer templates are stored in <a href=\"{{req_path C.USER_TEMPLATES \"/\" renderType \"res-list\"}}\">{{C.USER_TEMPLATES}}/{{renderType}}</a></p>\n\n    <label>render type</label>\n    <select name=\"_rt\">\n      <option value=\"\">not set</option>\n      <option disabled>-</option>\n{{#include C.USER_TEMPLATES \"rendertemplates\"}}\n      <option value=\"{{this}}\" {{eq this ../renderType \"selected\"}}>{{this}}</option>\n{{/include}}\n    </select>\n            \n    <label class=\"col-sm-4\">render super type</label>\n    <select class=\"form-control\" name=\"_st\">\n      <option value=\"\">not set</option>\n      <option disabled>-</option>\n{{#include C.USER_TEMPLATES \"rendertemplates\"}}\n      <option value=\"{{this}}\" {{eq this ../renderSuperType \"selected\"}}>{{this}}</option>\n{{/include}}\n    </select>\n\n    <h4>Renderer will take following types into consideration</h4>\n    <ol>\n{{#if renderType}}\n      <li>renderType: <b>{{renderType}}</b></li>\n{{else}}\n      <li>renderType: <b>no type set</b></li>\n{{/if}}\n{{#if renderSuperType}}\n      <li>renderSuperType: <b>{{renderSuperType}}</b></li>\n{{/if}}\n{{#if contentType}}\n      <li>contentType: mime/<b>{{contentType}}</b></li>\n{{/if}}\n      <li>resourceType: <b>{{type}}</b></li>\n{{#if superType}}\n      <li>superType: <b>{{superType}}</b></li>\n{{/if}}\n      <li>fallback: <b>any/any</b></li>\n    </ol>          \n\n    <input type=\"hidden\" name=\":forward\" value=\"{{ref_path R.PATH \"res-list\"}}\">\n    \n    <a href=\"{{req_path C.USER_TEMPLATES \"res-create\"}}\">Create New Template</a>\n    <a href=\"{{req_path R.PATH \"res-list\"}}\">Cancel</a>\n  \n    <input type=\"submit\" value=\"Save\">\n  </form>\n\n</body>\n\n</html>\n"}},"root":{"res-create.hbs":{"_ct":"text/plain","_pt":"resource/content","_content":"<!DOCTYPE html>\n<html lang=\"en\">\n\n<head>\n  <meta charset=\"utf-8\">\n  <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1\">\n  <link rel=\"icon\" href=\"data:;base64,iVBORw0KGgo=\">\n\n  <title>mount</title>\n</head>\n\n<body>\n  \n  <ol>\n    <li>HOME</li>\n{{#include \".\" \"parents\"}}\n    <li>{{name}}</li>\n{{/include}}\n    <li>{{name}}</li>\n  </ol>\n\n  <h5>Create ObjectResource as:</h5>\n\n  <form method=\"post\" action=\"{{res_path R.PATH \"{:name}\"}}\">\n    <input name=\":name|newUUID\" value=\"\" autocomplete=\"off\" placeholder=\"name\">\n    <input type=\"hidden\" name=\":forward\" value=\"{{req_path R.PATH \"res-list\"}}\">\n    <button type=\"submit\">add</button>\n  </form>\n\n  <h5>Import File</h5>\n  \n  <form method=\"post\" enctype=\"multipart/form-data\" action=\"{{R.PATH}}\">\n    <input type=\"file\" name=\":import\" value=\"\">\n    <input type=\"hidden\" name=\":forward\" value=\"{{req_path \".\" \"res-list\"}}\">\n\n    <button type=\"submit\">add</button>\n  </form>\n\n  <a href=\"{{req_path \".\" \"res-list\"}}\">Cancel</a>\n\n</body>\n</html>\n"}},"templates":{"rendertemplates.js":{"_ct":"text/javascript","_pt":"resource/content","_content":"(async function (res, writer, ctx) {\n  writer.start('object/javascript');\n  \n  let types = [];\n  \n  await ctx.listAllResourceNames('.', function (path) {\n    if (path.indexOf('.') > 0) {\n      let name = Utils.filename(path);\n      let dir = Utils.filename_dir(path).substr(1);\n      if (!types.includes(dir)) types.push(dir);\n    }\n  });\n\n  writer.write(types.sort());\n  writer.end();\n});\n"},"res-create.hbs":{"_ct":"text/plain","_pt":"resource/content","_content":"<!DOCTYPE html>\n<html lang=\"en\">\n\n<head>\n  <meta charset=\"utf-8\">\n  <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1\">\n  <link rel=\"icon\" href=\"data:;base64,iVBORw0KGgo=\">\n\n  <title>create</title>\n</head>\n\n<body>\n  \n  <ol>\n    <li>HOME</li>\n{{#include \".\" \"parents\"}}\n    <li>{{name}}</li>\n{{/include}}\n    <li>{{R.NAME}}</li>\n  </ol>\n\n  <h5>Create Renderer</h5>\n\n  <p>\n    Renderer template is resolved by scanning for a file matching specific naming convention pattern.\n  <p>\n    Pattern is composed of these parts: <br>\n    <span>resource type</span> - usually a directory<br>\n    <span>selector</span> - \"default\" or what gets appended after \"{{C.X}}\" like \"json\" for {{C.X}}json\n  <p>\n    for example:\n  <ul>\n    <li><span>web/mycomponent/</span><b>default.hbs</b></li>\n  </ul>\n\n  <form method=\"post\" action=\"{{R.PATH}}/{:name}/{:sel}.{:ext}\">\n    <select name=\":ext\">\n      <option value=\"hbs\">handlebars</option>\n      <option value=\"js\">javascript</option>\n    </select>\n\n    <input name=\":name\" value=\"{{R.DATA_PATH}}\" placeholder=\"resource path\" required=\"\" autocomplete=\"off\">\n    {{C.X}}\n    <input name=\":sel\" value=\"default\" placeholder=\"selector\" required=\"\" autocomplete=\"off\">\n    <input type=\"hidden\" name=\"_content\" value=\"\"> \n    <input type=\"hidden\" name=\"_rt\" value=\"resource/content\"> \n    <input type=\"hidden\" name=\":forward\" value=\"{{req_path \".\" \"/{:name}/{:sel}.{:ext}\" \"edit\"}}\">\n\n    <button type=\"submit\" value=\"add\">add</button>\n  </form>\n\n  <h5>Create Directory</h5>\n\n  <form method=\"post\" action=\"{{res_path R.PATH \"{:name}\"}}\">\n    <input name=\":name\" value=\"\" required=\"\" autocomplete=\"off\">\n    <input type=\"hidden\" name=\":forward\" value=\"{{req_path R.PATH \"res-list\"}}\">\n\n    <button type=\"submit\" value=\"add\">add</button>\n  </form>\n\n  <a href=\"{{req_path \".\" \"res-list\"}}\">Cancel</a>\n\n</body>\n\n</html>\n"}},"notfound":{"default.js":{"_ct":"text/javascript","_pt":"resource/content","_content":"(function (res, writer, context) {\n  //send 404 only if we are requesing this resource directly\n  if (context.getCurrentRequestPath() === context.getCurrentResourcePath()) {\n    context.sendStatus(404);\n    writer.end();\n  }\n  else {\n    writer.end();\n  }\n});\n"},"res-list.hbs":{"_ct":"text/plain","_pt":"resource/content","_content":"<!DOCTYPE html>\n<html lang=\"en\">\n\n<head>\n  <meta charset=\"utf-8\">\n  <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1\">\n  <link rel=\"icon\" href=\"data:;base64,iVBORw0KGgo=\">\n\n  <title>Delete</title>\n\n  <link href=\"{{C.BOOTSTRAP_CSS}}\" rel=\"stylesheet\">\n</head>\n\n<body>\n\n  <div role=\"dialog\">\n    <div class=\"modal-dialog\" role=\"document\">\n      <div class=\"modal-content\">\n        <div class=\"modal-header\">\n          <a class=\"close\" href=\"{{C.P}}{{R.PATH_APPEND}}../{{C.X}}res-list\"><span aria-hidden=\"true\">&times;</span></a>\n          <h4 class=\"modal-title\">Resource Not Found</h4>\n        </div>\n        <div class=\"modal-body\">\n\n          <ol class=\"breadcrumb\">\n            <li><a href=\"{{C.P}}/{{C.X}}res-list\">HOME</a></li>\n            {{#include \".\" \"parents\"}}\n              <li><a href=\"{{C.P}}{{path}}{{C.X}}res-list\">{{name}}</a></li>\n            {{/include}}\n            <li class=\"active\">{{R.NAME}}</li>\n          </ol>\n\n          <h4>Resource\"{{name}} not found, create?\"</h4>\n\n        </div>\n        <div class=\"modal-footer\">\n          <form class=\"form-inline\" method=\"post\" action=\"{{C.P}}{{R.PATH}}\">\n            <a class=\"btn btn-default\" href=\"{{C.P}}{{R.PATH_APPEND}}../{{C.X}}res-list\">Cancel</a>\n            <input type=\"hidden\" name=\":forward\" value=\"{{C.P}}{{R.PATH_APPEND}}{{C.X}}res-list\">\n            <input class=\"btn btn-success\" type=\"submit\" value=\"Create\">\n          </form>\n\n        </div>\n      </div><!-- /.modal-content -->\n    </div><!-- /.modal-dialog -->\n  </div><!-- /.modal -->\n\n</body>\n\n</html>\n\n"}}},"system":{"shell":{"edit.hbs":{"_ct":"text/plain","_pt":"resource/content","_content":"<!DOCTYPE html>\n<html lang=\"en\">\n\n<head>\n  <meta charset=\"utf-8\">\n  <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n  <title>Console</title>\n\n  <link href=\"{{C.BOOTSTRAP_CSS}}\" rel=\"stylesheet\">\n</head>\n  <style>\n    #commandline {\n      width: 100%;\n    }\n  </style>\n  <script>\n      window.addEventListener('DOMContentLoaded', function() {\n        var cmd = document.querySelector('#commandline');\n        if (cmd) {\n          cmd.focus();\n        }\n      });\n  </script>\n\n<body>\n  <div class=\"container\">\n\n    <ol class=\"breadcrumb\">\n      <li><a href=\"{{C.P}}/{{C.X}}res-list\">HOME</a></li>\n      {{#include \".\" \"parents\"}}\n        <li><a href=\"{{C.P}}{{path}}{{C.X}}res-list\">{{name}}</a></li>\n      {{/include}}\n      <li class=\"active\">{{R.NAME}}</li>\n    </ol>\n\n    <pre>\n{{include_safe \".\" \"text\"}}\n    </pre>\n\n    <form method=\"post\">\n      <input type=\"hidden\" name=\"_rt\" value=\"system/shell\">\n      <input id=\"commandline\" type=\"text\" autocorrect=\"off\" autocapitalize=\"none\" autocomplete=\"off\" spellcheck=\"false\" name=\":command\">\n    </form>\n\n  </div>\n</body>\n\n</html>\n"},"store.js":{"_ct":"text/javascript","_pt":"resource/content","_content":"(function (res, writer, context) {\n  var command = res.values[':command'];\n  var path = context.getCurrentResourcePath();\n\n  context.renderResource(path, '', '', function(contentType, content) {\n    try {\n      var tx = (content?content:'')+'\\n';\n      var rv = eval(command);\n      res.values['_content'] = tx + rv;\n    }\n    catch(ex) {\n      res.values['_content'] = tx + 'error:' + ex;\n    }\n\n    writer.write(res);\n    writer.end();\n  });\n});\n"}}},"_md":"1676379109362"}
